  params: {timezone: 'Europe/London'},
  headers: {
    'x-rapidapi-key': 'f413399469msh93fbc2a8f8dd7a4p1a5b19jsn435b2debc897',
    'x-rapidapi-host': 'api-football-v1.p.rapidapi.com'
  }
};

axios.request(options).then(function (response) {
